		4077E06C21C72EF400F46720 /* PBXBuildRule */ = {
			isa = PBXBuildRule;
			compilerSpec = com.apple.compilers.proxy.script;
			filePatterns = "*LinkDef.h";
			fileType = pattern.proxy;
			inputFiles = (
			);
			isEditable = 1;
			outputFiles = (
				"$(DERIVED_FILE_DIR)/${PRODUCT_MODULE_NAME}Dict.cpp",
				"$(DERIVED_FILE_DIR)/${PRODUCT_MODULE_NAME}Dict_rdict.pcm",
			);
			script = "#\n# Script to create the dictionary for a multi class LinkDef file.\n# The names of the header files are extracted from the LinkDef file.\n# The name of the dictionary files will be based on the PRODUCT_MODULE_NAME\n#\necho \"INPUT_FILE_NAME = ${INPUT_FILE_NAME}\"\necho \"INPUT_FILE_BASE = ${INPUT_FILE_BASE}\"\necho \"PRODUCT_MODULE_NAME = ${PRODUCT_MODULE_NAME}\"\nHEADER_LIST=`cat ${INPUT_FILE_DIR}/${INPUT_FILE_NAME} | gawk '/pragma *link *C++.*class /{a=$5;print gensub(/+;/,\"\",\"g\",a)\".h\" }' `\necho \"HEADER_LIST = ${HEADER_LIST}\"\nHEADER_LIST_FULL=`for i in $HEADER_LIST; do echo ${INPUT_FILE_DIR}/${i}; done`\necho \"HEADER_LIST_FULL = ${HEADER_LIST_FULL}\"\necho ${ROOTSYS}/bin/rootcint -f ${DERIVED_FILE_DIR}/${PRODUCT_MODULE_NAME}Dict.cpp -c -p -I${HEADER_SEARCH_PATHS// / -I} ${HEADER_LIST_FULL} ${INPUT_FILE_DIR}/${INPUT_FILE_NAME}\n\n${ROOTSYS}/bin/rootcint -f ${DERIVED_FILE_DIR}/${PRODUCT_MODULE_NAME}Dict.cpp -c -p -I${HEADER_SEARCH_PATHS// / -I} ${HEADER_LIST_FULL} ${INPUT_FILE_DIR}/${INPUT_FILE_NAME}\n\n\n# For ROOT 6 copy the pcm file to the LIB install path.\ntest -d ${DYLIB_INSTALL_NAME_BASE} || mkdir -p ${DYLIB_INSTALL_NAME_BASE}\ntest -d ${BUILT_PRODUCTS_DIR} || mkdir -p ${BUILT_PRODUCTS_DIR}\n# ls ${DERIVED_FILE_DIR}\n# This puts the pcm files in the ${DSTROOT}/${INSTALL_PATH} directory.\necho \"Send dict file to: \" ${DYLIB_INSTALL_NAME_BASE}\nif test -r ${DERIVED_FILE_DIR}/${PRODUCT_MODULE_NAME}Dict_rdict.pcm; then cp -f ${DERIVED_FILE_DIR}/${PRODUCT_MODULE_NAME}Dict_rdict.pcm ${DYLIB_INSTALL_NAME_BASE}/${PRODUCT_MODULE_NAME}Dict_rdict.pcm ; fi\n# cp  ${DERIVED_FILE_DIR}/${DICT_BASE_NAME}Dict_rdict.pcm ${DYLIB_INSTALL_NAME_BASE}\n# This send the pcm files to to build product dir\necho \"Send file rdict.pcm to: \" ${BUILT_PRODUCTS_DIR}\nif test -r ${DERIVED_FILE_DIR}/${PRODUCT_MODULE_NAME}Dict_rdict.pcm; then cp -f ${DERIVED_FILE_DIR}/${PRODUCT_MODULE_NAME}Dict_rdict.pcm ${BUILT_PRODUCTS_DIR}/${PRODUCT_MODULE_NAME}Dict_rdict.pcm ; fi\n";
		};
		40D3003021C34AE300381AF5 /* PBXBuildRule */ = {
			isa = PBXBuildRule;
			compilerSpec = com.apple.compilers.proxy.script;
			filePatterns = "*.h";
			fileType = pattern.proxy;
			inputFiles = (
			);
			isEditable = 1;
			outputFiles = (
				"$(DERIVED_FILE_DIR)/${PRODUCT_MODULE_NAME}Dict_rdict.pcm",
				"$(DERIVED_FILE_DIR)/${PRODUCT_MODULE_NAME}Dict.cpp",
			);
			script = "# This rule creates the dictionaries for a ROOT based library.\n#\n# This one is a variant on the \"EvioTool\" version: \n#   The input file is \"Event.h\", but the files used to create the \n#   dictionaries are: EventDef.h and EventLinkDef.h\n#\n# As input it needs the header file for the class that needs a dictionary, i.e. myclass.h\n# Each of these header files needs a \"LinkDef\" file: <myclass>LinkDef.h\n# To allow multiple classes, with separate headers, in one dictionary file,\n# it needs a  <myclass>Def.h where all the headers are included.\n#\n# The output will be <myclass>Dict.cpp and <myclass>Dict_rdict.pcm\n# The cpp files must be compiled and included in the library. The rdict.pcm must be copied\n# to the install location of the library.\n#\n# The script depends on ROOTSYS being defined in the project.\n#\n# export\nOUTFILES_LOCATION=${DERIVED_FILE_DIR}\nLINKDEF_FILE=${INPUT_FILE_BASE}LinkDef.h\nHEADER_DEF_FILE=${INPUT_FILE_BASE}Def.h\necho \"INPUT_FILE_PATH: \" ${INPUT_FILE_PATH} \necho \"Dictionary created in: \" ${OUTFILES_LOCATION}\necho \"INPUT_FILE_BASE = \" ${INPUT_FILE_BASE}\necho \"INSTALL_DIR\" = ${INSTALL_DIR}\n#\necho ${ROOTSYS}/bin/rootcling -f ${OUTFILES_LOCATION}/${INPUT_FILE_BASE}Dict.cpp -c -p -I${HEADER_SEARCH_PATHS// / -I} ${INPUT_FILE_DIR}/${HEADER_DEF_FILE} ${INPUT_FILE_DIR}/${LINKDEF_FILE}\n${ROOTSYS}/bin/rootcling -f ${OUTFILES_LOCATION}/${INPUT_FILE_BASE}Dict.cpp -c -p -I${HEADER_SEARCH_PATHS// / -I} ${INPUT_FILE_DIR}/${HEADER_DEF_FILE} ${INPUT_FILE_DIR}/${LINKDEF_FILE}\n#\n# For ROOT 6 copy the pcm file to the LIB install path.\n#\ntest -d ${DYLIB_INSTALL_NAME_BASE} || mkdir -p ${DYLIB_INSTALL_NAME_BASE}\ntest -d ${BUILT_PRODUCTS_DIR} || mkdir -p ${BUILT_PRODUCTS_DIR}\n# ls ${DERIVED_FILE_DIR}\n# This puts the pcm files in the ${DSTROOT}/${INSTALL_PATH} directory.\nif test -r ${OUTFILES_LOCATION}/${INPUT_FILE_BASE}Dict_rdict.pcm; then cp -f ${OUTFILES_LOCATION}/${INPUT_FILE_BASE}Dict_rdict.pcm ${DYLIB_INSTALL_NAME_BASE}/${INPUT_FILE_BASE}Dict_rdict.pcm; echo \"Copied: \" ${OUTFILES_LOCATION}/${INPUT_FILE_BASE}Dict_rdict.pcm ${DYLIB_INSTALL_NAME_BASE}/${INPUT_FILE_BASE}Dict_rdict.pcm ; fi\n# This send the pcm files to to build product dir\nif test -r ${OUTFILES_LOCATION}/${INPUT_FILE_BASE}Dict_rdict.pcm; then cp -f ${OUTFILES_LOCATION}/${INPUT_FILE_BASE}Dict_rdict.pcm ${BUILT_PRODUCTS_DIR}/${INPUT_FILE_BASE}Dict_rdict.pcm; echo \"Copied:\" cp -f ${OUTFILES_LOCATION}/${INPUT_FILE_BASE}Dict_rdict.pcm   ${BUILT_PRODUCTS_DIR}/${INPUT_FILE_BASE}Dict_rdict.pcm; fi\n\n";
		};
/* End PBXBuildRule section */

